import React from 'react';
import Nav from './Nav';
import useFetchUser from './useFetchUser';

const myPage = () => {
    const { user } = useFetchUser();

    return (
        <div>
            <div>
                <Nav user={user} />
            </div>
        </div>
    );
};

export default myPage;
